import React from 'react'
import { Link } from 'react-router-dom';
import "./Header.css"
const Header = () => {
  return (
    <div className='Nav'>
        <Link><img></img></Link>
        <Link>Home</Link>
        <Link>Top Rated</Link>
        <Link>Popular</Link>
        <Link></Link>
    </div>
  )
}

export default Header;
